  return (
    <div id="footer" className="padding-top-btm-2e">
      <Container>
        <Row xs={12} sm={12} md={12}>
          <Col></Col>
        </Row>
      </Container>
      <Grid item>
        <div>
          <span className="font-color-gray font-07">
            HYUNSEUNG SEOK{" "}
            <span className="font-color-pink font-bold">@2020</span>
          </span>
        </div>
      </Grid>
    </div>
  );
}

export default Footer;
